package learning;

public class Relationaloperat {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		
		int i = 12, j=6;
		
		System.out.println(i==j);//false
		System.out.println(i!=j);//true
		System.out.println(i<j);//false
		System.out.println(i>j);//true
		System.out.println(i<=j);//false
		System.out.println(i>=j);//true
 
	}

}
